import React from 'react';
import '../scss/master.scss';
import Header from "./Header";
import Articles from "./Articles";
import Footer from "./Footer";

function App() {
  return (
    <div>
      <Header />
      <Articles />
      <Footer />
    </div>
  );
}

export default App;
